import React, { Component } from "react";

let constUrl = "https://edge.dev1.nextgen.xpms.ai/api/content/search/";

class TableGrid extends React.Component {
  constructor(props) {
    super(props);
    this.getItemList = this.getItemList(bind);
  }

  state = {};
  render() {
    return (
      <div className="col m-2 badge-secondary">
        {
          (this.props.itemList.map = (ele) => (
            <div className="row">
              <div className="col"></div>
              <div className="col"></div>
              <div className="col"></div>
              <div className="col"></div>
            </div>
          ))
        }
      </div>
    );
  }

  getItemList() {
    const payload = {
      search_text: "",
      search_on: "document",
      pagination: { no_of_records: 10, page: 1 },
      solution_id: "testrdflib",
      api: "document",
    };
    fetch(constUrl, {
      method: "POST",
      body: JSON.stringify(payload),
      headers: {
        "Content-Type": "application/json",
        "Content-type": "application/x-www-form-urlencoded",
      },
    })
      .then((res) => res.json())
      .then((response) => {
        console.log(response);
      })
      .catch((error) => console.error("Error:", error));
  }
}
window.onload = function () {
    getItemList();
};

export default TableGrid;
